import React, { Fragment } from "react";

const CreatePoll = () => {

    const style = {
        marginTop: '40px',
        marginLeft: '60px'
    }

    const textStyle = {
        width: '300px'
    }

    return ( 
      
    <Fragment >
        <h2>Create a new poll</h2>
      <div className="form-group" style={style}>
        <label htmlFor="example1">Large input</label>
        <input style={textStyle} type="text" id="example1" className="form-control form-control-lg" />
      </div>

      <div className="form-group" style={style}>
        <label htmlFor="example1">Large input</label>
        <input style={textStyle} type="text" id="example1" className="form-control form-control-lg" />
      </div>

      <div className="form-group" style={style}>
        <label htmlFor="example1">Large input</label>
        <input style={textStyle} type="text" id="example1" className="form-control form-control-lg" />
      </div>
 
    </Fragment>
    
    )
}

export default CreatePoll
